import React from "react";
import Card from './Card';
import Sdata from './Sdata';
import './index.css';

const App=()=>(
    <>
    <h1 className="heading_style">Top 5 netflix series</h1>
    {Sdata.map((val)=>{
        return(
            <Card
            
            imgsrc={val.imgsrc}
            title={val.title}
            sname={val.sname}
            link={val.link} 

            />
        );
    })}
    </>
);


export default App;
